import{_ as e}from"./plugin-vue_export-helper-c27b6911.js";import{o as a,c as t,h as r}from"./app-be0a1a34.js";const i={},n=r('<div class="hint-container tip"><p class="hint-container-title">九月</p><p>Growing your taste to build better products.</p></div><h2 id="前言" tabindex="-1"><a class="header-anchor" href="#前言" aria-hidden="true">#</a> 前言</h2><p>如果拥有良好的品味是构建优秀软件的关键。但味道是主观的。我可能会认为某部电影或一家餐厅很棒，但你可能会认为它很糟糕。尽管存在这种主观性，但还是有一些共同因素可以磨练你对几乎所有事物的品味。</p><h2 id="如何提高品味" tabindex="-1"><a class="header-anchor" href="#如何提高品味" aria-hidden="true">#</a> 如何提高品味</h2><ol><li>看的更多<br> 如果您一生只看过两部电影，那么您很可能会认为这两部电影都相当不错。但如果你看过一千部，你就会真正知道如何区分优秀与优秀。</li><li>在一个方面做的更深<br> 提炼并辨别您正在探索的产品中的组件。</li></ol><h2 id="反思" tabindex="-1"><a class="header-anchor" href="#反思" aria-hidden="true">#</a> 反思</h2><p>品味不仅仅是制造产品的品味，同样也是为人处世的品味。要时刻有三人行必有我师焉，则其善者而从之，其不善者而改之的思想，不断打磨自己的技能。同样也要在某一方面，如技术或者是与人交流方面进行深潜，多看多学习，当你攀登上一座座高山时，或许就可以一览众山小了。</p>',7),o=[n];function c(d,h){return a(),t("div",null,o)}const _=e(i,[["render",c],["__file","009-2024-9.html.vue"]]);export{_ as default};
